		/* **EECpurchase*/
				
		/*EECcheckout*/
		EECcheckout = function() {
			var step=-1;
			if (document.getElementById("be_date") != null){
				step=1;
			}  
			else if (document.getElementById("be_occupancy") != null) {
				step=2;
				}
			else if (document.getElementById("be_options") != null) {
				step=3;
			}  
			else if (document.getElementById("be_pax") != null) {
				step=4;
			}  
			else if (document.getElementById("be_address") != null) {
				step=5;
			}  
			else if (document.getElementById("be_paymethod") != null) {
				step=6;
			}  
			else if (document.getElementById("be_check") != null) {
				step=7;
			}  

			if (step > 0) {
				var dataCode = $(document).find(".offer-code").text();
				dataCode = dataCode.substr(dataCode.lastIndexOf(":")+1); 
				
				var offerName = document.getElementsByClassName("offer-item-title");
				if (offerName[0] != null) {
					var h3 = offerName[0].getElementsByTagName("h3");
					if (h3[0]=!null) {
						var prodName = h3[0].innerHTML
					}
				}
				if (step > 2) {
					tPrice = priceVal($(document).find(".booking-totals-price").text());
				}
				
				if ((step ==1) ||(step ==2)) {
					dataLayer.push({'event':'EECcheckout',
													'ecommerce': {
														'currencyCode': curr,
															'checkout':{
																'actionField':{'step':step},
																'products':[{
																		'name': prodName,
																		'id':dataCode,
																		'brand':brand,
																		'quantity':1
																 }]
															}
													}
					});  
				}
				
				if ((step ==3) ||(step ==4)||(step ==5)||(step ==7)){
					dataLayer.push({'event':'EECcheckout',
													'ecommerce': {
														'currencyCode': curr,
															'checkout':{
																'actionField':{'step':step},
																'products':[{
																		'name': prodName,
																		'id':dataCode,
																		'price':tPrice,
																		'brand':brand,
																		'quantity':1
																 }]
															}
													}
					});  
				}
				
				if (step == 6) {
					dataLayer.push({'event':'EECcheckout',
													'ecommerce': {
														'currencyCode':curr,
															'checkout':{
																'actionField':{'step':6},
																'products':[{
																	'name': prodName,
																	'id':dataCode,
																	'price':tPrice,
																	'brand':brand,
																		'quantity':1
																}]
															}
													}
					});  
				}
			}				
		};
		/* **EECcheckout*/				

