		/* navigation header*/
		navigationHeader = function(){
			$(".header-main-nav-inner").click(function(event) {
				try {
					var clickEl = $(event.target);
					var eventLabel;
					var liste = clickEl.parentsUntil( $(".header-main-nav-inner") , "li");
					var navPath ='';
					var step;
						
					for (var l = 0; l < liste.length ; l++) {
						step = $(clickEl).parents('li:eq('+l+')').find("a:first").text();
						navPath= step+'::'+navPath; 
					}
					eventLabel = navPath.substring(0,navPath.length-2)
					var eventAction = "Top_L"+liste.length;
					
					dataLayer.push({'event':'uaevent',
													'eventCategory':'Navigation',
													'eventAction':eventAction,
													'eventLabel':eventLabel
					});  
				} catch(ex) {}
			});
		};
