		/* sidebar filter*/
		sidebarFilter = function() {
			$('.sidebar-item').click(function(event) {
				try {
					var reiseziele ='';
					var reiseart = '';
					var abflughafen = '';
					var zeitraum = '';
					var verpflegung = '';
					var kategorie = '';
						
					$(".sidebar-item-content").find(".traveltype").find(".dropdown-menu.inner.selectpicker").find(".selected").each(function(){
						try {
							reiseart = reiseart +','+ $.trim($(this).find("span.text").text()); 
						} catch(ex) {}     
					});
					reiseart = 'Reiseart: '+ reiseart.substr(1);
		
					$(".destination-dropdown-menu INPUT:checked").each(function(){
						try {
							reiseziele = reiseziele +','+ $.trim($(this).parent().text());      
						} catch(ex) {}
						});
					reiseziele =', Reiseziele: '+ reiseziele.substring(1);

					$(".sidebar-item-content").find(".airport").find(".dropdown-menu.inner.selectpicker").find(".selected").each(function(){
						try {
							abflughafen = abflughafen +','+ $.trim($(this).find("span.text").text());      
						} catch(ex) {}
					});
					abflughafen = ', Abflughafen: '+ abflughafen.substr(1);

					var dateFrom =$("[name='p_dateFrom']").val();     
					var dateTo =$("[name='p_dateTo']").val();     
					if (dateFrom !=0) {
						zeitraum = zeitraum + ', Zeitraum::{' +dateFrom;
					}
					if (dateTo !=0) {
						zeitraum = zeitraum + ' - ' +dateTo;
					}
					if ((dateFrom !=0)||(dateTo !=0)) {
						zeitraum = zeitraum + '}';
					}

					$(".sidebar-item-content").find(".dropdown-menu.inner.selectpicker").find(".selected").each(function(){
						try {
							 verpflegung = verpflegung +','+ $.trim($(this).find("span.text").text());      
						} catch(ex) {}
					});
					verpflegung = ', Verpflegung: '+ verpflegung.substr(1);
		
					$("[name='p_categories']").each(function(){
						try {
							if ($(this).is(":checked")) {
								kategorie = kategorie +','+ $(this).parent().attr( "title");      
							}
						} catch(ex) {}
					});
					kategorie = ', Kategorie: '+ kategorie.substr(1);

					dataLayer.push({'event':'uaevent',
													'eventCategory':'Reise Finden',
													'eventAction':'Filter',
													'eventLabel': reiseart + ' ' +reiseziele+ ' ' +abflughafen + ' ' + zeitraum + ' ' + verpflegung+ ' ' + kategorie
					});  
				} catch(ex) {}     
			});
		};
